import ABI from ".//ABI";

const petrol_address = "0xf9190ba5f8fe0ea9c3cfe585df886b38f4dcc7f8";

const newPetrolContract = web3 => {
    return new web3.eth.Contract(ABI, petrol_address);
};

export default newPetrolContract;
